        setShowLinks(!showLinks)
    }
    return (

        <div className={`navbar ${showLinks ? "show-nav" : "hide-nav"} `}>
            <Link to="/" className="link"className="navbar_item slide" >INFOS</Link>
            <Link to="/graphiques" className="link"className="navbar_item slideInDown-1">GRAPHIQUES</Link>
